message:
Compilação Coronel GALDI Patriota51:
Mostre q vc é um Fiscal de Votação Credenciado com todo o direito de exercer a sua função e, se preciso, vc tomará as medidas legais para isso.

Orientação Preliminar aos Fiscais de Votação:
1. Não usar camiseta/boné/material de campanha c/ nome/n° de candidato ou padronizada q identifique candidato;
2. Chegar às 7h, fim: vigiar a chegada da urna;
3. em cada sessão só é permitido 1 Fiscal dentro (acompanhar o início dos trabalhos) e 1 fora da sala (checar se há boca de urna ou outra ilegalidade);
4. observe e não permita q o Fiscal da outra Federação tente influenciar os eleitores, ele tb não pode usar veste/material do candidato, apenas usar o "crachá com nome e sigla do Partido/Federação".

Orientação Antes da Abertura dos Trabalhos (07 às 08h):

1. Sala de Votação
1.1 *Montagem da Mesa de Votação*:  peça q fique a 1 m da parede para q vc, Fiscal, possa *passar por trás dela* (garantir q vc visualize as etapas do mesário para liberar a Votação de cada eleitor sem q ele se sinta incomodado).
1.2 Vasculhe a sala sobre *santinhos/adesivos/escritos* na Cabine de Votação ou lousa a favor de candidato ou número de partido; atenção o tempo todo na sala e quando regressar a ela. Caso haja algum material/escrito, peça aos mesários q *removam tudo q não seja material legal e apaguem informações de candidatos na lousa/cabine*;
1.3  Cheque a lista dos candidatos completa e sem marcas, dentro da Cabine de Votação e do lado de fora da Sala;

2. Emissão da *Zerésima*, impressão q informa a inexistência de votos já na urna: cheque se os *dois candidatos* estão com seu *número correto* e se saem com *votação individual zerada* (Erro: não imprimindo ou sem dados dos candidatos: *informar ao Coordenador*, pois a *urna DEVE ser substituída )* e o *fato registrado na ata* ao final dos Trabalhos.              

Orientação à Abertura dos Trabalhos 08h:
3. a votação deve se iniciar às 08h, com a *presença de Presid da Mesa e do Secretário*. O Fiscal de Votação preenche, assina e entrega seu crachá com o Doc: *Requisição de Boletim de Urna* em duas vias (uma assinada pelo Presid de Seção com *Protocolo RECEBIDO*);
4. Acesso/permanência na Sala de votação: só mesários, eleitores, Fiscais, Advog/Delegados da Federação/Partido; ninguém pode fazer campanha ou pedir voto, nem estar acompanhado de *pessoas portando material de campanha: devem ser retirados do local* de votação. Nos corredores, *podem portar bandeira/broche/adesivo* desde q *de forma isolada*, em manifestação  pessoal espontânea (prestar atenção qdo vão e vem, pode ser *boca de urna disfarçada*);
5. Auxílio no instante do Voto: *mesário é proibido de auxiliar eleitor* junto à urna, *convoque o Coordenador se ocorrer*); eleitor PNE pode contar com *apoio de pessoa de sua confiança até digitando* na urna, desde q não esteja a svç da Justiça Eleitoral nem de partidos;  em garantia ao sigilo do voto, eleitores *não podem usar celular/apar. eletrônico dentro da Sala de Votação de modo algum*, mas eleitor analfabeto/cego pode usar dispositivo mecânico q o auxilie a votar (não é fornecido pela Jus Eleitoral);
6. Documento de Identificação (só se tem foto, não vale certidão de nascim./casamento) deve ser conferido pelo mesário; eleitor só com título de eleitor não votará (art. 91-A, Lei 9.504).

Orientação Durante a Votação 08h às 17h:
7. *autorizado*, o eleitor vai até a cabina e o *Presid da Seção não poderá manusear o terminal* de sua mesa enquanto não se encerrar o voto. Se houver *clara dificuldade* em encerrá-la, o Presid suspenderá aquele voto digitando 12x dígito "5" 555555555555 ( *não permita que use o código para impedir o direito do eleitor* votar: é última instância, para desembaraçar o processo de votação);
8.    Sistema de biometria (a prosseguir com minha compilação. ..)
